import React from 'react'
import { BrowserRouter as Link } from 'react-router-dom'

const Blog = ({ blog, ...props }) => {

    return(
        <li>
            <Link to={`/blogs/${blog.id}`}>{blog.title}</Link>
        </li>
    )
}


export default Blog
